import './sidebar.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope } from '@fortawesome/free-solid-svg-icons'

function Item(props) {
    return (
        <div className="Item">
            <FontAwesomeIcon icon={props.icon} />
            <label>{props.title}</label>
        </div>
    );
}

export default Item;
